import React,{useEffect} from "react"

const CityDisp=(props)=>{
    //need to update if sending obj
    useEffect=(()=>{
        console.log('extra cities:',props.cities)
    },[props.cities])
    const cities=props.cities.map(city=>{
        return(
            //would prefer slightly lighter grey
            <li style={{color:'light grey',marginLeft:25}}>{city.name+'_'+city.code}</li>
        )
    })
    return(
        <div className="box">
            <div style={{height:100,maxHeight:100,marginTop:20,}}>
                <h3 style={{color:'light grey',marginLeft:15}}>Cities:</h3>
                <ul>
                    {cities}
                </ul>
            </div>
        </div>
    )
}

export default CityDisp
